import React from "react";

const Phone = () => {
  return (
    <>
      <div className="phone-number">
        <div className="check-in">
          <div className="phone-number">
            <label>Phone Number:</label>
            <input type="number" placeholder="Phone Number" />
            <button className="next">Next</button>
          </div>
        </div>
      </div>
    </>
  );
};

export default Phone;
